shorcuts offers you several ways to compute a normal vector field onto the whole digital surface or onto a part of it. You can already view the "true" normal vector field of the implicit surface. It was computed and displayed with these two lines auto true_normals = SHG3::getNormalVectors( shape, K, surfels, params );
psMesh->addFaceVectorQuantity( "True normal vector field", true_normals ); There are several normal vector fields that are computable by shorcuts (see philosophy of shorcuts module ): ShortcutsGeometry::getTrivialNormalVectors: returns the trivial (T) normal vectors to the given surfel range ShortcutsGeometry::getCTrivialNormalVectors: returns the convolved trivial (CT) normal vectors to the given surfel range ShortcutsGeometry::getVCMNormalVectors: returns the Voronoi Covariance Measure (VCM) normal vectors to the given surfel range ShortcutsGeometry::getIINormalVectors: returns the Integral Invariant (II) normal vectors to the given surfel range (embedded in a binary image or a digitized implicit shape) Some of these methods are influenced by the Parameter object. However, they have default reasonnable values. Exercise : add computation of several normal vector fields You can for instance add the computation of the trivial (T), the convolved trivial (CT) and integral invariant (II) normal estimator. If you wish to let the user choose, you can use ImGui::RadioButton. int Estimator;
... ImGui::RadioButton("Method 0", &Estimator, 0); ImGui::SameLine(); ImGui::RadioButton("Method 1", &Estimator, 1); ImGui::SameLine(); ImGui::RadioButton("Method 2", &Estimator, 2); (T) vector field of sphere $h=1$ (II) vector field of sphere $h=1$ trivial ii Exercise (optional) : view errors in normal estimation shorcuts provides you method to compute the angle error between two unit vector field. You may observe where the angle error is big by adding a face scalar quantity to your mesh: psMesh->addFaceScalarQuantity( "Angle error", angle_diff ) ->setMapRange( { 0.0, M_PI / 20.0 } ) // 10° is bad ! ->setColorMap( "coolwarm" ); (T) angle error of sphere $h=1$ (II) angle error of sphere $h=1$ error-t-1 error-ii-1 Exercise (optional) : compute \(l_2\) and \(l_\infty\) errors in normal estimation You can also compute the \(l_\infty\)-error of normal vector estimation, by computing the maximum of angle errors. For the \(l_2\)-error, the easiest way is to compute the squared root of the variance of angle errors. Use ShorcutsGeometry::getStatistic to get a statistic object from your vector of angle errors. For the sphere9 object, you would get something like: sphere9 \(l_\infty\)-error (T) \(l_\infty\)-error (CT) $l_\infty$-error (II) \(h=1\) 1.516 0.141 0.139 \(h=0.5\) 1.543 0.190 0.077 \(h=0.25\) 1.557 0.183 0.041 Only the (II) estimator looks multigrid convergent.
